import React from 'react';
import './Footer.css';
import { Link } from 'react-router-dom';

function Footer() {
  return (
    <div className='footer-container'>
            <div id="contentFooter">
              <div id="legalMentions">
                <Link to='/Mentions'>
                 mentions légales
               </Link>
              </div>
              <div id="contact">
                <a>nous contacter</a>
              </div>
              <div id="discord">
                <a href="https://discord.gg/2fraMTyujp">Discord des développeurs</a>
              </div>
              <div id="grpd">
                <a href="https://github.com/nightcoding-ai/Azakana/wiki/GDPR">protection des données</a>
              </div>
            <Link to='/' className='social-logo'>
              Azakana
            </Link>
            

            </div>
    </div>
  );
}

export default Footer;
